import {IoIosArrowDroprightCircle} from 'react-icons/io'

const Projects=(props)=>{
    const {pimg,data}=props
    return(
        <>
        <h1>Projects</h1>
        <div className="revese-box">

        <img className="container-img" src={pimg}></img>
        <div className="text-continer">
        <ul className="project-ul"> 
           {
               data.map((d)=>{
                   return (<li key={d.id}>
                   <p className="text">
                       {d.title} , {d.technology}
                   </p>
                   <ul>
                   <li><IoIosArrowDroprightCircle></IoIosArrowDroprightCircle> {d.subtitle}</li>
                   <li>Codelink:<a href={d.codelink}>code</a></li>
                   <li>Projectlink:<a href={d.link}>Link</a></li>
                   </ul>
                   </li>
                   )

                })
            }
        </ul>
        </div>
        </div>
        </>
    )
}
export default Projects;
